export class Evaluation {
  constructor(id, name, description, title, subTitle, image) {
    this.id = id;
    this.name = name;
    this.description = description;
    this.title = title;
    this.subTitle = subTitle;
    this.image = image;
  }

  get Id() {
    return this.id;
  }

  get Name() {
    return this.name;
  }

  set Name(name) {
    this.name = name;
  }

  get Description() {
    return this.description;
  }

  set Description(description) {
    this.description = description;
  }

  get SubTitle() {
    return this.subTitle;
  }

  set SubTitle(subTitle) {
    this.subTitle = subTitle;
  }

  get Title() {
    return this.title;
  }

  set Title(title) {
    this.title = title;
  }

  get Image() {
    return this.image;
  }

  set Image(image) {
    this.image = image;
  }

}
